import logo from "./logo.svg";
import "./App.css";

// import components
import Navigation from "./Components/Navigation/Navigation";
import Hero from "./Components/Hero/Hero";
import About from "./Components/About/About";

function App() {
  return (
    <div className="App">
      <Navigation />
      <Hero />
      <About />
    </div>
  );
}

export default App;
